import ExpenseItem from "./components/Expenses/ExpenseItem";


function App() {
  const expenses = [
    {
      id: "e1",
      title: "Car Insurance",
      amount: 295.4,
      date: new Date(2021, 2, 3),
    },
    { id: "e2", title: "Bill", amount: 29.4, date: new Date(2021, 2, 3) },
    { id: "e3", title: "Day Care", amount: 1295, date: new Date(2021, 2, 3) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem/>
      <ExpenseItem/>
      <ExpenseItem/>
      <ExpenseItem/>
    </div>
  );
}

export default App;
